        avg(case  when  activity = 'Leisure, social and associative life except TV and video' then  value end)  as 'Leisure, social and associative life ...',
         avg(case  when  activity = 'TV and video' then  value end)  as 'TV and video',
          avg(case  when  activity = 'Travel to/from work/study' then  value  end) as 'Travel to/from work/study' ,
           avg(case  when  activity = 'Unspecified time use and travel' then  value end)  as 'Unspecified'
      from hack.mart_eu_main_activity_rate   eu
join cls_eu_sex sex on eu.sex =sex.description
join cls_eu_countries cnt on eu.country =cnt.description
      where sex.id = in_sex and cnt.id = in_country
      and start_time like 'From%'
 group by hour;
END ;;
